          "name" : "Pradeep2024-A Mechanical modelling framework for studying endothelial permeability",
          "format" : {
            "name" : "Other",
            "version" : "*"
          },
          "publication" : {
            "journal" : "Biophysical journal",
            "title" : "A mechanical modelling framework to study endothelial permeability.",
            "affiliation" : "School of Mathematics, University of Birmingham, Birmingham, B15 2TS, UK. Electronic address: p.keshavanarayana@bham.ac.uk.",
            "synopsis" : "The inner lining of blood vessels, the endothelium, is made up of endothelial cells. Vascular endothelial (VE)-cadherin protein forms a bond with VE-cadherin from neighbouring cells to determine the size of gaps between the cells and thereby regulate the size of particles that can cross the endothelium. Chemical cues such as thrombin, along with mechanical properties of the cell and extracellular matrix (ECM) are known to affect the permeability of endothelial cells. Abnormal permeability is found in patients suffering from diseases including cardiovascular diseases, cancer, and COVID-19. Even though some of the regulatory mechanisms affecting endothelial permeability are well studied, details of how several mechanical and chemical stimuli acting simultaneously affect endothelial permeability are not yet understood. In this article, we present a continuum-level mechanical modelling framework to study the highly dynamic nature of the VE-cadherin bonds. Taking inspiration from the catch-slip behaviour that VE-cadherin complexes are known to exhibit, we model VE-cadherin homophilic bond as cohesive contact with damage following a traction-separation law. We explicitly model the actin-cytoskeleton, and substrate to study their role in permeability. Our studies show that mechano-chemical coupling is necessary to simulate the influence of the mechanical properties of the substrate on permeability. Simulations show that shear between cells is responsible for the variation in permeability between bi-cellular and tri-cellular junctions, explaining the phenotypic differences observed in experiments. An increase in the magnitude of traction force due to disturbed flow that endothelial cells experience results in increased permeability, and it is found that the effect is higher on stiffer ECM. Finally, we show that the cylindrical monolayer exhibits higher permeability than the planar monolayer under unconstrained cases. Thus, we present a contact mechanics-based mechano-chemical model to investigate the variation in permeability of endothelial monolayer due to multiple loads acting simultaneously.",
