        {
          "name" : "Henze2017 - A Dynamical Model for Activating and Silencing the Mitotic Checkpoint",
          "description" : "<notes xmlns=\"http://www.sbml.org/sbml/level2/version4\">\n      <body xmlns=\"http://www.w3.org/1999/xhtml\">\n     <p>The spindle assembly checkpoint (SAC) is an evolutionarily conserved mechanism, exclusively sensitive to the states of kinetochores attached to microtubules. During metaphase, the anaphase-promoting complex/cyclosome (APC/C) is inhibited by the SAC but it rapidly switches to its active form following proper attachment of the final spindle. It had been thought that APC/C activity is an all-or-nothing response, but recent findings have demonstrated that it switches steadily. In this study, we develop a detailed mathematical model that considers all 92 human kinetochores and all major proteins involved in SAC activation and silencing. We perform deterministic and spatially-stochastic simulations and find that certain spatial properties do not play significant roles. Furthermore, we show that our model is consistent with in-vitro mutation experiments of crucial proteins as well as the recently-suggested rheostat switch behavior, measured by Securin or CyclinB concentration. Considering an autocatalytic feedback loop leads to an all-or-nothing toggle switch in the underlying core components, while the output signal of the SAC still behaves like a rheostat switch. The results of this study support the hypothesis that the SAC signal varies with increasing number of attached kinetochores, even though it might still contain toggle switches in some of its components.</p>\n  </body>\n    </notes>",
          "format" : {
            "name" : "SBML",
            "version" : "L2V4"
          },
          "publication" : {
            "journal" : "Scientific reports",
            "title" : "A Dynamical Model for Activating and Silencing the Mitotic Checkpoint.",
            "affiliation" : "Department of Mathematics and Computer Science, Friedrich Schiller University Jena, 07743, Jena, Germany.",
            "synopsis" : "The spindle assembly checkpoint (SAC) is an evolutionarily conserved mechanism, exclusively sensitive to the states of kinetochores attached to microtubules. During metaphase, the anaphase-promoting complex/cyclosome (APC/C) is inhibited by the SAC but it rapidly switches to its active form following proper attachment of the final spindle. It had been thought that APC/C activity is an all-or-nothing response, but recent findings have demonstrated that it switches steadily. In this study, we develop a detailed mathematical model that considers all 92 human kinetochores and all major proteins involved in SAC activation and silencing. We perform deterministic and spatially-stochastic simulations and find that certain spatial properties do not play significant roles. Furthermore, we show that our model is consistent with in-vitro mutation experiments of crucial proteins as well as the recently-suggested rheostat switch behavior, measured by Securin or CyclinB concentration. Considering an autocatalytic feedback loop leads to an all-or-nothing toggle switch in the underlying core components, while the output signal of the SAC still behaves like a rheostat switch. The results of this study support the hypothesis that the SAC signal varies with increasing number of attached kinetochores, even though it might still contain toggle switches in some of its components.",
